version: "1"

package:
  id: org.deepin.Runtime
  name: deepin runtime
  kind: runtime
  version: 2405.0.0.1
  description: |
    Qt is a cross-platform C++ application framework. Qt's primary feature
    is its rich set of widgets that provide standard GUI functionality.

base: org.deepin.foundation/2405.0.0/arm64

build: |
  set -x
  ./packages.bash > "$PREFIX/packages.list"
  # 跳过qtchooser安装
  echo Package: qtchooser >> "$PREFIX/packages.list"
  source init.bash
  ./qtbase.bash 2>&1 | tee qtbase.log
  ./modules.bash 2>&1 | tee modules.log

